measurements.description:
Four starry flowers on two upright 11-cm inflorescences; 

 sepals and petals soft light green, petals slightly porrect;

 lip cream, keels light yellow, midlobe lightly flushed pink laterally, light green apically; 

 column light green, speckled maroon ventrally, anther cap cream;
 substance firm; texture matte.
